import styled from "styled-components"

const PList = styled.div`
    width: 100%;
    max-width: 1024px;
    display: flex;
    justify-content: space-between;
    gap: 20;
`;
const PListItem = styled.div`
    border-radius: 10px;
    overflow: hidden;
    cursor: pointer;
`;
const Image = styled.img`
    width: 100%;
    height: 150px;
    object-fit: cover;
`;
const PListItemTitles = styled.div``;
const PListItemTextB = styled.h1``;
const PListItemTextS = styled.h2``;

const PropertyList = () => {
  return (
    <PList>
      <PListItem>
        <Image src="https://images.pexels.com/photos/4023389/pexels-photo-4023389.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Hotels</PListItemTextB>
        <PListItemTextS>2333 Hotels </PListItemTextS>
        </PListItemTitles>
      </PListItem>
      <PListItem>
        <Image src="https://images.pexels.com/photos/338523/pexels-photo-338523.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Resorts</PListItemTextB>
        <PListItemTextS>2333 Resorts </PListItemTextS>
        </PListItemTitles>
      </PListItem>
      <PListItem>
        <Image src="https://images.pexels.com/photos/1438834/pexels-photo-1438834.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Villas</PListItemTextB>
        <PListItemTextS>2333 Villas </PListItemTextS>
        </PListItemTitles>
      </PListItem>
      <PListItem>
        <Image src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Cabins</PListItemTextB>
        <PListItemTextS>2333 Cabins </PListItemTextS>
        </PListItemTitles>
      </PListItem>
      <PListItem>
        <Image src="https://images.pexels.com/photos/2994300/pexels-photo-2994300.jpeg?auto=compress&cs=tinysrgb&w=400" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Motels</PListItemTextB>
        <PListItemTextS>2333 Motels </PListItemTextS>
        </PListItemTitles>
      </PListItem>
      <PListItem>
        <Image src="https://images.pexels.com/photos/1571460/pexels-photo-1571460.jpeg?auto=compress&cs=tinysrgb&w=400" alt=""/>
        <PListItemTitles>
        <PListItemTextB>Apartments</PListItemTextB>
        <PListItemTextS>2333 Apartments </PListItemTextS>
        </PListItemTitles>
      </PListItem>
    </PList>
  )
}

export default PropertyList
